    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"913221","type":"CustomJS"},{"attributes":{},"id":"912972","type":"LinearScale"},{"attributes":{"source":{"id":"912801"}},"id":"912807","type":"CDSView"},{"attributes":{"source":{"id":"913009"}},"id":"913015","type":"CDSView"},{"attributes":{"data":{"Close":{"__ndarray__":"CtejcD0aVUCF61G4HoVVQOF6FK5H8VRA4XoUrkdBVUCamZmZmYlVQFK4HoXrYVVA7FG4HoVrVUBcj8L1KDxVQArXo3A9alVAFK5H4Xr0VUApXI/C9ShWQM3MzMzMHFZAXI/C9SisVUDNzMzMzJxVQJqZmZmZOVVAKVyPwvU4VUB7FK5H4ZpVQPYoXI/C1VVAAAAAAACAVUCF61G4HsVVQK5H4XoUvlVA9ihcj8LFVUC4HoXrUfhUQEjhehSu51RA4XoUrkfRVECuR+F6FO5UQArXo3A9ilVAZmZmZmaWVUCuR+F6FM5VQHsUrkfhmlVAPQrXo3C9VUAzMzMzM+NVQOF6FK5H4VVAexSuR+E6VkCPwvUoXN9VQArXo3A9SlZAmpmZmZlJV0CF61G4HjVXQD0K16NwjVdAj8L1KFxvV0DD9Shcj3JXQBSuR+F6tFdAmpmZmZm5V0DhehSuR+FXQBSuR+F6JFhA4XoUrkeBV0BxPQrXoyBYQHsUrkfhmlhAPQrXo3D9WEDsUbgehXtZQGZmZmZmxlhAKVyPwvVYWEAK16NwPTpYQFyPwvUozFdAmpmZmZmJWEAUrkfhejRYQEjhehSuV1hACtejcD3aVkAzMzMzMzNXQJqZmZmZqVVAj8L1KFz/VUDNzMzMzGxVQAAAAAAAgFVApHA9CteTVUCamZmZmdlVQI/C9ShcL1ZAZmZmZmZ2VkA9CtejcD1WQBSuR+F65FVAKVyPwvX4VUAUrkfheoRVQI/C9Shcf1VA16NwPQrXVUCamZmZmSlWQClcj8L1OFZAZmZmZmbmVUBSuB6F65FVQMP1KFyP8lRASOF6FK5nVUCPwvUoXG9VQDMzMzMz01RA7FG4HoVbVEAK16NwPcpUQEjhehSu91RAw/UoXI/iVUApXI/C9XhVQFyPwvUobFVA9ihcj8KFVUAK16NwPTpVQBSuR+F6hFVA4XoUrkfBVUCamZmZmalVQAAAAAAAwFVAzczMzMyMVUBSuB6F6wFWQDMzMzMzE1ZAexSuR+FaVkBxPQrXo7BWQIXrUbgelVdAj8L1KFx/V0AUrkfheoRXQJqZmZmZaVhApHA9CtfjWEDNzMzMzBxZQFK4HoXroVlA4XoUrkcRWkCamZmZmflZQFyPwvUorFlAcT0K16MwWkCkcD0K1/NZQLgehetReFpAw/UoXI8CW0AzMzMzM8NaQLgehetRCFtAhetRuB61WkAzMzMzM6NZQNejcD0KJ1pArkfhehTOWUBmZmZmZqZZQFyPwvUojFlAZmZmZmamWUD2KFyPwlVaQClcj8L1mFpAXI/C9ShcWkDNzMzMzHxaQFyPwvUoTFpAmpmZmZl5WUA9CtejcA1ZQMP1KFyPElhAAAAAAADgV0C4HoXrUThXQLgehetRuFZAexSuR+HqVUCF61G4HtVVQDMzMzMzI1ZAAAAAAAAwVkCuR+F6FC5XQArXo3A9GldAZmZmZmaGVkBcj8L1K
